public class InnerOriginEndpointHlsManifestConfigurationFactory(Action<Humidifier.MediaPackageV2.OriginEndpointTypes.HlsManifestConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.MediaPackageV2.OriginEndpointTypes.HlsManifestConfiguration>
{

    internal InnerOriginEndpointScteHlsFactory ScteHlsFactory { get; set; }

    internal InnerOriginEndpointFilterConfigurationFactory FilterConfigurationFactory { get; set; }

    protected override Humidifier.MediaPackageV2.OriginEndpointTypes.HlsManifestConfiguration Create()
    {
        var hlsManifestConfigurationResult = CreateHlsManifestConfiguration();
        factoryAction?.Invoke(hlsManifestConfigurationResult);

        return hlsManifestConfigurationResult;
    }

    private Humidifier.MediaPackageV2.OriginEndpointTypes.HlsManifestConfiguration CreateHlsManifestConfiguration()
    {
        var hlsManifestConfigurationResult = new Humidifier.MediaPackageV2.OriginEndpointTypes.HlsManifestConfiguration();

        return hlsManifestConfigurationResult;
    }
    public override void CreateChildren(Humidifier.MediaPackageV2.OriginEndpointTypes.HlsManifestConfiguration result)
    {
        base.CreateChildren(result);

        result.ScteHls ??= ScteHlsFactory?.Build();
        result.FilterConfiguration ??= FilterConfigurationFactory?.Build();
    }

} // End Of Class

